class FeAristImageUploadController extends Controller
{

    public function __invoke($action = 1, Request $request)
    {     
        $objUser = \Contao\FrontendUser::getInstance();

        if ($objUser->id != null)
        {
            #$picture = base64_decode($request->request->get('image'));

            $picture = 'data:image/png;base64,%E2%80%A6';
            #return new JsonResponse( array('status' => $picture ) ); 

            $normalizer = new DataUriNormalizer();
$avatar = $normalizer->denormalize($picture, 'SplFileObject');
// $avatar is a SplFileObject with the GIF image contents

            $homeDirModel = FilesModel::findByUuid($objUser->homeDir);

            $strFile = $homeDirModel->path . "/usr" . $objUser->id . ".jpg";

            $newFile = new File($strFile, false);
            $newFile->write( $avatar );
            $newFile->close();
            
            $objFile = \Dbafs::addResource($strFile);

            $objUser->pictureSRC = $objFile->uuid;
            $objUser->save();


            return new JsonResponse( array('status' => true ) ); 

        }

        return new JsonResponse( array('status' => false ) ); 
    }

}

